import React, { useState, useContext } from 'react';

import {Wrapper} from "../../StyledComponents/Wrapper";
import {Title, Label2} from "./../../Layouts/styledLayouts";
import Select from "../../controls/Select/Select";
import OfferParams from "../../controls/OfferParams/OfferParams"

import {modifyForReactSealect} from "../../../utils/utils";

const PreferedSize = ({params, step, onChange}) => {

    console.log('params', params)

    return (
        <>
            <Title mb={25} >Some organizational details about your offer:</Title>
            <Wrapper mt={30} mb={10} >
                {!!params.length && <OfferParams params={params} step={step} onChange={onChange}/>}
            </Wrapper>


        </>
    );
};

export default PreferedSize;
